import React, { Component } from 'react'
import {Col, Row, Container} from "react-bootstrap";

export class Facilites extends Component {
    render() {
        return (
            <div>
                <Container>
                    <Row>
                        <Col md="6">
                            <div className="sectionTitle">
                             <span>About us</span>
                            <h2>Our Facilities</h2>
                    </div>
                        </Col>
                        <Col md="6"></Col>
                    </Row>
                </Container>
            </div>
        )
    }
}

export default Facilites
